        <div className={styles.infoContainer}>
            <div style={{ height: '100vh', width: '100%' }}>
                <GoogleMapReact
                //bootstrapURLKeys={{ key: /* YOUR KEY HERE */ }}
                defaultCenter={59.45,30.33}
