                >
                <AnyReactComponent
                    lat={59.955413}
                    lng={30.337844}
                    text="My Marker"
                />
                </GoogleMapReact>
      </div>
            <div>
                <h1>contact Us</h1>
            </div>
        </div>
    )
}

export default Information
